pub fn get_soql_root_grammar_id() -> GrammarId {
    GrammarId(1290)
}
pub fn get_soql_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_soql_root_grammar_id(),
        tables: &SOQL_TABLES,
    }
}
pub fn get_soql_root_grammar() -> RootGrammar {
    get_soql_root_grammar_table()
}
